function divider (){
      return<div style ={{position: "fixed"}}>
        <div className="d-flex flex-column col-1   align-items-center justify-content-evenly" style={{height:"80vh" }}>
      <h2> <i className="bi bi-house-fill text-success"></i></h2>


      <h2><i className="bi bi-person-fill text-success">  </i></h2>


      <h2><i className="bi bi-chat-text-fill text-success"> </i></h2>


      <h2><i className="bi bi-bar-chart-line-fill text-success"></i></h2>


      <h2><i className="bi bi-gear-fill text-success"></i></h2>


      <h2><i className="bi bi-box-arrow-left text-success"></i></h2>
  </div>
      </div>;
}
export default divider ;
